import React from 'react';

const ExpenseForm = () => {
  return (
    <div>
      <div>
        <label>Expense title</label>
        <input />
      </div>
      <div>
        <label>Expense Amount</label>
        <input />
      </div>

    </div>
  );
}

export default ExpenseForm;
